import BusinessInfo from '../components/businessInfo';

const CollectionDetails = (props) => {

    const businessInfo = [
        {name: "FaceNovel", amount: 30000, type: "Recruit New Staff"},
        {name: "WeVlog", amount: 30000000, type: "But other business"},
        {name: "LibroPedia", amount: 75000, type: "Borrow in anticipation of a revenue source"},
        {name: "Coin Byte", amount: 250000, type: "Recruit New Staff"}
]

let businessUI = businessInfo.map((info)=>{
    return(<BusinessInfo name={info.name} amount={info.amount} type={info.type} />)
})

    return(
        [businessUI]
    )
}; 

export default CollectionDetails;
